r improperly handling objects in     memory. (CVE-2014-4113)\n\n  - A remote code execution vulnerability allows a remote     attacker to run arbitrary code in kernel mode due to the     kernel-mode driver improperly handling TrueType fonts.\n    An attacker can exploit this vulnerability by convincing     a user to open a file or visit a website containing a     specially crafted TrueType font file. (CVE-2014-4148)',_binary 'M\ÔøΩ(z\ÔøΩÔøΩmÔøΩÔøΩ\ÔøΩSÔøΩE\ÔøΩr.Y}ÔøΩ–º@œûÔøΩÔøΩ\ÔøΩ\ÔøΩqÔøΩ9I1ÔøΩÔøΩ:JÔøΩ!\ÔøΩÔøΩ÷®\ÔøΩUSÔøΩÔøΩ0\ÔøΩ;ÔøΩÔøΩV\rTf:)\ÔøΩ');
